import {Component} from '@angular/core';
import {MatTableModule} from '@angular/material/table';
import { TableUtil } from "./TableUtil";

export interface PeriodicElement {
  nombre: string;
  apellido: string;
  sexo: string;
  edad: number;
  telefono: string;
  localidad: string;
}

const ELEMENT_DATA: PeriodicElement[] = [
  {nombre: 'Jonathan', apellido: 'Hydrogen', sexo: "Masculino", edad: 20,telefono:"9394853",localidad:"Lima"},
  {nombre: 'Lyara', apellido: 'Hydrogen', sexo: "Masculino", edad: 20,telefono:"9394853",localidad:"Lima"}
];

@Component({
  selector: 'app-registro',
  templateUrl: './registro.component.html',
  styleUrls: ['./registro.component.css']
})
export class RegistroComponent {
  displayedColumns: string[] = ['Nombre', 'Apellido', 'Sexo', 'Edad','Telefono','Localidad'];
  dataSource = ELEMENT_DATA;

  exportTable(){
    TableUtil.exportToPdf("ExampleTable");
  }

}
